window.bookSummaryJSON = "<p><b>An Unseelie king. A halfling princess. Enemies born to end an ancient curse.</b><br> <br> Merrin Fionbharr, the Princess of Air, has dreamed about the beautiful silver fae for as long as she can remember. In snow and blood, she sees his death, certain she is fated to save him.<br> <br> The Silver King, Riven na Duinn, is obsessed with visions of the halfling Seelie princess. Too bad she's his enemy's daughter. But when he finds himself at Merri's mercy, the terrible attraction only grows. Even so, for the sake of his kingdom . . . he has no choice but to kill her.<br> <br> <b>No matter what the Black Blood curse foretells.</b><br> <br> Contains mature themes.</p>"; 
